import React from 'react';
import './index.scss'


function NavItem(props){
  const { title } = props;
  return (
    <div className="nav-item">
      <div className="border-animation">
        <h3>{title.toUpperCase()}</h3>
      </div>
    </div>
  )
}

export default NavItem;
